    "2015-06-19T13:49:48.011512",nt"name": "terrain-barnstable-county-massachusetts",nt"isopen":
    false,nt"url": null,nt"notes": "Terrain data, as defined in FEMA Guidelines
    and Specifications, Appendix N: Data Capture Standards, describes the digital topographic
    data that was used to create the elevation data representing the terrain environment
    of a watershed and/or floodplain. Terrain data requirements allow for flexibility
    in the types of information provided as sources used to produce final terrain deliverables.
    Once this type of data is provided, FEMA will be able to account for the origins
    of the flood study elevation data. (Source: FEMA Guidelines and Specifications,
    Appendix N, Section N.1.2). LiDAR was collected at a 1.0 meter nominal post spacing
    (1.0m GSD) for Barnstable County, Massachusetts as part of the American Recovery
    and Reinvestment Act (ARRA) of 2010, while no snow was on the ground and rivers
    were at or below normal levels. This project require 1.0 meter nominal post spacing
    (1.0m GSD), and a required 9.25cm Vertical Accuracy. Some areas along the coast
    of Massachusetts were to be collected under the constraints of Tidal Conditions.
    Project meets U.S. Geological Survey National Geospatial Program Base LiDAR Specification,
    Version 12.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
